from models.picks import *
from lookups import *
import logging
from google.appengine.ext import db

class LoadPicks:

    def __init__(self):
        self.load()

    def num_transactions(self):
        return len(self.transactions)

    def run_transactions(self,txn_range):
        last_index = self.num_transactions() - 1
        for i in txn_range:
            if (i%100) == 0:
                logging.info('...picks %d' % (i))
            if i > last_index:
                break
            d = self.transactions[i]
            self.add_pick(d)

    def __lookup(self,name,recno):
        if not(name) or not(recno):
            return None
        q = db.GqlQuery('SELECT * FROM Lookup WHERE name=:name and recno=:recno',name=name,recno=recno)
        assert q
        result = list(q)
        assert len(result) == 1
        return result[0].instance_key

    def add_pick(self,pick):
        p = Pick()
        p.week = self.__lookup('week',pick['week'])
        p.player = self.__lookup('player',pick['player'])
        p.game = self.__lookup('game',pick['game'])
        p.winner = pick['winner']
        p.team1_score = int(pick['team1_score']) if pick['team1_score'] else None
        p.team2_score = int(pick['team2_score']) if pick['team2_score'] else None
        key = p.put()

